const Orders = ({ orderArr, orderNum }) => {

  console.log(orderArr);



  // const res = orderArr.map(el => {
  //   console.log(el); 
  // });

  // console.log(res);

  // for (let i = 0; i <= orderArr.length - 1; i++) {
  //   console.log(orderArr);
  //   orderArr[i].map(element => {
  //     console.log(element);

  //   })
  // }


  return (
    <>
      <div className={s.wrap}>
        <div className={s.orderNum}>
          {/* {

            } */}
        </div>
        <hr />
        <div>
          {
            Object.entries(orderArr).map(([key, value]) =>
              <div>
                <p>{key}</p>
                {Object.entries(values).map(([key, value]) =>
                  <div>
                    <p>{value.name}</p>
                  </div>
                )}
              </div>
            )}


        </div>
      </div>
    </>
  );
}

export default Orders;
